POST /account/:foreignID Create or update an Account :foreignID is a gobal, (or shard)-unique identifier from your system which you will use to address this account in subsequent requests. REQUEST BODY: Expected POST Body, an empty {} is fine to touch an account into existence. { "payout_address" : "<P2PKH Dogecoin Address>", // optional for auto-payout "payout_threshold" : "<decimal amount of dogecoin before auto-payout>" //optional "payout_frequency" : "<duration in seconds for time-based auto-payouts>" //optional } RESPONSE BODY: Example response from POST {} /account/123456789 { "foreign_id": "12345789", "id": "DRQu6WR6bpU9N4rm87PvpWZLQSqmGgphFD", "payout_address": "", "payout_frequency": "", "payout_threshold": "0"
} Your account is now created with an HD wallet managed by Gigawallet. GET /account/:foreignID Get an Account RESPONSE BODY: Example response from GET /account/123456789 { "foreign_id": "12345789", "id": "DRQu6WR6bpU9N4rm87PvpWZLQSqmGgphFD", "payout_address": "", "payout_frequency": "", "payout_threshold": "0"
} GET /account/:foreignID/balance Get an Account's AccountBalance { "CurrentBalance": "1000", // Current balance available for spending "IncomingBalance": "24.89774", // Incoming payments which have not met the confirmation threshold "OutgoingBalance": "0" // Outgoing payments which have not met the confirmation threshold
} POST /account/:foreignID/pay Send a payment from this account to an Address REQUEST BODY: { "amount": "420.69, "to": "DPeTgZm7LabnmFTJkAPfADkwiKreEMmzio" }

