POST /account/:foreignID/invoice _Create an Invoice :foreignID is the unique identifier from your system which you used to create an account. REQUEST BODY: Expected POST Body: { "items": [ { "name": "Dogecoin Sticker", "value": "100.00", "quantity": 1, "type": "item" } ], "required_confirmations": 3
} RESPONSE BODY: { "id": "DMcUQWwMdpdXqiYNiYgCzrM5Wn85dYerQH", "items": [ { "type": "item", "name": "Dogecoin Sticker", "sku": "", "description": "", "value": "100", "quantity": 1, "image_link": "" } ], "created": "2023-08-30T16:49:51.705419+10:00", "total": "100", "pay_to_address": "DMcUQWwMdpdXqiYNiYgCzrM5Wn85dYerQH", "part_payment_detected": false, "total_payment_detected": false, "total_payment_confirmed": false, "payment_unconfirmed": false, "estimate_seconds_to_confirm": 0
} GET /account/:foreignID/invoice/:invoiceID Get an Invoice for a specific account :foreignID is the unique identifier from your system which you used to create an account. :invoiceID is the unique identifier for an invoice, ie: DMcUQWwMdpdXqiYNiYgCzrM5Wn85dYerQH. RESPONSE BODY: { "id": "DMcUQWwMdpdXqiYNiYgCzrM5Wn85dYerQH", "items": [ { "type": "item", "name": "Dogecoin Sticker", "sku": "", "description": "", "value": "100", "quantity": 1, "image_link": "" } ], "created": "2023-08-30T16:49:51.705419+10:00", "total": "100", "pay_to_address": "DMcUQWwMdpdXqiYNiYgCzrM5Wn85dYerQH", "part_payment_detected": false, "total_payment_detected": false, "total_payment_confirmed": false, "payment_unconfirmed": false, "estimate_seconds_to_confirm": 0
} GET /account/:foreignID/invoices?limit=100&cursor=0 Enumerate an Invoice for a specific account. :foreignID is the unique identifier from your system which you used to create an account. limit is the maximum number of records to return. cursor starts at 0, and should be set to the cursor value returned by a previous call. Those familiar with popular cursor-based APIs such as AWS etc should understand this pattern, it allows for machine-to-machine fetching of all invoices and should not be confused with an offset/limit style API. The response contains two elements, items which is an array of invoices, and cursor which should be passed to the next invocation. A cursor of 0 indicates there are no further records. RESPONSE BODY: {
"items": [ { "id": "DMcUQWwMdpdXqiYNiYgCzrM5Wn85dYerQH", "items": [ { "type": "item", "name": "Dogecoin Sticker", "sku": "", "description": "", "value": "100", "quantity": 1, "image_link": "" } ], "created": "2023-08-30T16:49:51.705419+10:00", "total": "100", "pay_to_address": "DMcUQWwMdpdXqiYNiYgCzrM5Wn85dYerQH", "part_payment_detected": false, "total_payment_detected": false, "total_payment_confirmed": false, "payment_unconfirmed": false, "estimate_seconds_to_confirm": 0 } ], "cursor": 0
}

